import './portfolio_form.css';

function PortfolioForm() {
    return (
        <div className="PortfolioForm">
            <p>
                Welcome to the portfolio form
            </p>
            <p><a href="/">Take me back home!</a></p>
        </div>
    );
}

export default PortfolioForm;
